import React from "react";
import Link from "next/link";
import ontheMend from "public/Image/OntheMend.png";

const NavBar = (props) => {
  return (
    <header className="height">
      <nav
        className=" height uk-flex uk-flex-middle uk-card tm-background-black zIndex"
        uk-navbar="">
        <div className="uk-navbar-left">
          <ul className="uk-navbar-nav ">
            <li className="uk-text-large">
              <Link href="/">
                <a className="uk-padding-small uk-logo">
                  <img
                    className="uk-preserve uk-margin-small-right"
                    data-src={"/Image/Logo.svg"}
                    width="30"
                    height="30"
                    alt="logo"
                    uk-img=""
                  />
                  <img
                    data-src={ontheMend}
                    width="100"
                    height="100"
                    alt="logo"
                    uk-img=""
                  />
                </a>
              </Link>
            </li>
          </ul>
        </div>
        <div className="uk-navbar-right">
          <ul className="uk-navbar-nav">
            <li className="uk-text-large button_padding">
              <Link href="/login">
                <button className="uk-button uk-button-primary uk-button-small">
                  Login
                </button>
              </Link>
            </li>
            <li className="uk-text-large button_padding">
              <></>
            </li>
          </ul>
        </div>
      </nav>
      <style jsx>
        {`
          .height {
            height: 60px;
          }
          .button_padding {
            padding: 10px;
          }

          .signup_padding {
            padding-left: 5px;
            padding-right: 10px;
          }

          .signup_dropdown {
            width: 220px;
          }

          .zIndex {
            z-index: 100;
          }
        `}
      </style>
    </header>
  );
};

export default NavBar;
